-- ----------------------------
-- Table structure for tb_book
-- ----------------------------
DROP TABLE IF EXISTS `tb_book`;
CREATE TABLE `tb_book` (
  `bkID` int NOT NULL AUTO_INCREMENT COMMENT '图书序号【自增，主键】',
  `bkCode` varchar(20) DEFAULT NULL COMMENT '图书编号或条码号（前文中的书号）',
  `bkName` varchar(50) DEFAULT NULL COMMENT '书名',
  `bkAuthor` varchar(30) DEFAULT NULL COMMENT '作者',
  `bkPress` varchar(50) DEFAULT NULL COMMENT '出版社',
  `bkDatePress` datetime DEFAULT NULL COMMENT '出版日期',
  `bkISBN` varchar(15) DEFAULT NULL COMMENT 'ISBN书号',
  `bkCatalog` varchar(30) DEFAULT NULL COMMENT '分类号（如：TP316-21/123）',
  `bkLanguage` int DEFAULT NULL COMMENT '语言：0-中文，1-英文，2-日文，3-俄文，4-德文，5-法文',
  `bkPages` int DEFAULT NULL COMMENT '页数',
  `bkPrice` decimal(4,1) DEFAULT NULL COMMENT '价格',
  `bkDateIn` datetime DEFAULT NULL COMMENT '入馆日期',
  `bkBrief` text COMMENT '内容简介',
  `bkCover` longblob COMMENT '图书封面照片',
  `bkStatus` char(2) DEFAULT NULL COMMENT '图书状态：在馆、借出、遗失、变卖、销毁',
  PRIMARY KEY (`bkID`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb3;

-- ----------------------------
-- Records of tb_book
-- ----------------------------
INSERT INTO `tb_book` VALUES ('2', '10000000000', '孩子爱看的十二生肖故事', '柯渔/文 于桐洋/图', '黑龙江少年儿童出版社', '2022-01-31 00:00:00', '9787531973881', 'TP316-21/123', '0', '300', '24.5', '2023-12-09 00:00:00', '生肖和每个中国人都息息相关，中国传统文化绘本《孩子爱看的十二生肖》，以“十二个生肖”为主题，将民间传说故事赋予了新的解读，将各显神通的生肖动物描绘得生动、幽默、有趣。本套绘本增添了各个生肖动物的相关风俗和秘密档案，如“老鼠嫁女”“二月二龙抬头”“外国也有生肖”等，使绘本内容更丰富，让小读者进入传统文化的世界，不知不觉地领略民族文化和民族精神的魅力。', , '遗失');

-- ----------------------------
-- Table structure for tb_borrow
-- ----------------------------
DROP TABLE IF EXISTS `tb_borrow`;
CREATE TABLE `tb_borrow` (
  `BorrowID` int NOT NULL AUTO_INCREMENT COMMENT '借阅顺序号【自增，主键】',
  `rdID` int DEFAULT NULL COMMENT '读者序号【外键TB_Reader.rdID】',
  `bkID` int DEFAULT NULL COMMENT '图书序号【外键TB_Book.bkID】',
  `ldContinueTimes` int DEFAULT '0' COMMENT '续借次数（第一次借时，记为0），缺省为0',
  `ldDateOut` datetime DEFAULT NULL COMMENT '借书日期',
  `ldDateRetPlan` datetime DEFAULT NULL COMMENT '应还日期',
  `ldDateRetAct` datetime DEFAULT NULL COMMENT '实际还书日期',
  `ldOverDay` int DEFAULT '0' COMMENT '超期天数，缺省为0',
  `ldOverMoney` decimal(6,2) DEFAULT '0.00' COMMENT '超期金额（应罚款金额），缺省为0',
  `ldPunishMoney` decimal(6,2) DEFAULT '0.00' COMMENT '罚款金额，缺省为0',
  `lsHasReturn` bit(1) DEFAULT b'0' COMMENT '是否已经还书，缺省为0-未还',
  `OperatorBorrow` varchar(20) DEFAULT NULL COMMENT '借书操作员',
  `OperatorReturn` varchar(20) DEFAULT NULL COMMENT '还书操作员',
  PRIMARY KEY (`BorrowID`),
  KEY `rdID` (`rdID`),
  KEY `bkID` (`bkID`),
  CONSTRAINT `tb_borrow_ibfk_1` FOREIGN KEY (`rdID`) REFERENCES `tb_reader` (`rdID`) ON DELETE RESTRICT ON UPDATE RESTRICT,
  CONSTRAINT `tb_borrow_ibfk_2` FOREIGN KEY (`bkID`) REFERENCES `tb_book` (`bkID`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb3;

