-- ----------------------------
-- Table structure for tb_reader
-- ----------------------------
DROP TABLE IF EXISTS `tb_reader`;
CREATE TABLE `tb_reader` (
  `rdID` int NOT NULL COMMENT '读者编号/借书证号【主键】',
  `rdName` varchar(20) DEFAULT NULL COMMENT '读者姓名',
  `rdSex` char(1) DEFAULT NULL COMMENT '性别：男/女',
  `rdType` int NOT NULL COMMENT '读者类别【外键TB_ReaderType】【非空】',
  `rdDept` varchar(20) DEFAULT NULL COMMENT '单位代码/单位名称',
  `rdPhone` char(11) DEFAULT NULL COMMENT '电话号码',
  `rdEmail` varchar(30) DEFAULT NULL COMMENT '电子邮箱',
  `rdDateReg` datetime DEFAULT NULL COMMENT '读者登记日期/办证日期',
  `rdPhoto` longblob COMMENT '读者照片',
  `rdStatus` char(2) DEFAULT NULL COMMENT '证件状态，3个：有效、挂失、注销',
  `rdBorrowQty` int DEFAULT '0' COMMENT '已借书数量（缺省值0）',
  `rdPwd` varchar(20) DEFAULT NULL COMMENT '读者密码（初值123），可加密存储',
  `rdAdminRoles` int DEFAULT NULL COMMENT '管理角色：0-读者、1-借书证管理、2-图书管理、4-借阅管理、8-系统管理，可组合',
  PRIMARY KEY (`rdID`),
  KEY `rdType` (`rdType`),
  CONSTRAINT `tb_reader_ibfk_1` FOREIGN KEY (`rdType`) REFERENCES `tb_readertype` (`rdType`) ON DELETE RESTRICT ON UPDATE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;

