-- Table structure for tb_readertype
-- ----------------------------
DROP TABLE IF EXISTS `tb_readertype`;
CREATE TABLE `tb_readertype` (
  `rdType` int NOT NULL COMMENT '读者类别【主键】',
  `rdTypeName` varchar(20) NOT NULL COMMENT '读者类别名称【唯一、非空】',
  `CanLendQty` int DEFAULT NULL COMMENT '可借书数量',
  `CanLendDay` int DEFAULT NULL COMMENT '可借书天数',
  `CanContinueTimes` int DEFAULT NULL COMMENT '可续借的次数',
  `PunishRate` decimal(3,2) DEFAULT NULL COMMENT '罚款率（元/天）',
  `DateValid` int NOT NULL COMMENT '证书有效期（年）【非空，0表示永久有效】',
  PRIMARY KEY (`rdType`),
  UNIQUE KEY `rdTypeName` (`rdTypeName`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;

